import React from 'react';
import style from '../Tool/Style';
import LockOutlinedIcon from '@material-ui/icons/LockOutlined';
import { Avatar, Button, Container, TextField, Typography } from '@material-ui/core';

const Login = () => {
    return (
        <Container maxWidth="xs">
            <div style={style.paper}>

                {/* Dentro d 'avatar' colocaremos el icono */}
                <Avatar style={style.avatar}>
                <LockOutlinedIcon style={style.icon}/>
                </Avatar>
                <Typography component="h1" variant="h5">
                    Login de Usuario
                </Typography>
                <form style={style.form}>
                    <TextField variant="outlined" label="Ingrese username" name="username" fullWidth margin=""/>
                    <TextField variant="outlined" type="password" name="password" label="password" fullWidth/>
                    <Button type="submit" fullWidth variant="contained" color="primary" style={style.submit}>
                        Enviar
                    </Button>

                </form>

            </div>

        </Container>
        
    );
};

export default Login;
